import React, { Component } from "react";
import Fade from "react-slideshow-image/lib/components/slideshow/fade";
import lehighLogo from "../images/lehigh-logo.png";
import lehigh1 from "../images/lehigh-1.png";
import lehigh2 from "../images/lehigh-4.png";
import lehigh3 from "../images/lehigh-5.png";

const slideProperties = {
  duration: 5000,
  transitionDuration: 2000,
  infinite: true,
  indicators: true,
  arrows: true
};

class Education extends Component {
  state = {
    slideImages: [
      { id: 1, value: lehigh1 },
      { id: 2, value: lehigh2 },
      { id: 3, value: lehigh3 }
    ]
  };

  render() {
    return (
      <div className="education-container">
        <div className="education">
          <div className="left">
            <img
              className="lehigh-logo"
              src={lehighLogo}
              alt="Lehigh Univserity Logo"
            />
          </div>
          <div className="middle">
            <p className="lehigh-name">LEHIGH UNIVERSITY</p>
            <p className="lehigh-date">2006-2010</p>
            <p className="lehigh-address">
              27 Memorial Dr W, Bethlehem, PA 18015
            </p>
            <p>
              Bachelor of Science; <i>Finance</i> <br />
              Minor in <i>Psychology; Sociology</i>
            </p>
          </div>
          <div className="right">
            <div className="slide-container">
              <Fade {...slideProperties}>
                {this.state.slideImages.map(slide => (
                  <div key={slide.id} className="each-fade">
                    <img
                      className="lehigh-photo"
                      src={slide.value}
                      alt="Lehigh University"
                    />
                  </div>
                ))}
              </Fade>
            </div>
          </div>
        </div>
      </div>
    );
  }
}

export default Education;
